  (P0506) IDLE CONTROL RPM LOWER THAN EXPECTED: !!com.romraider.definition.table.TableBlobDef {
    category: Diagnostic Trouble Codes, name: (P0506) IDLE CONTROL RPM LOWER THAN EXPECTED,
    scaling: (P0506)IDLECONTROLRPMLOWERTHANEXPECTED}
  Base Timing Idle B (In-Gear)(Below Speed Threshold): !!com.romraider.definition.table.Table2DDef
    category: Ignition Timing - Advance
    description: This is the base timing in idle mode when vehicle speed is less than the 'Base Timing Idle Vehicle Speed Threshold' and transmission is not in neutral.
    level: 2
    name: Base Timing Idle B (In-Gear)(Below Speed Threshold)
    scaling: BaseIgnitionTiming(degreesBTDC)
    staticyaxis:
      data: ['400', '600', '800', '1000', '1200', '1400', '1600', '1800', '2000']
      elements: 9
      name: Engine Speed (RPM)
  Tip-in Enrichment Compensation B (ECT) Activation: !!com.romraider.definition.table.Table2DDef
    category: Fueling - Tip-in Enrichment
    description: This is the minimum throttle tip-in for the 'Tip-in Enrichment Compensation B (ECT)' table to be active. This table does not act independently and other requirements must also be met in order for tip-in enrichment to be active.
    level: 2
    name: Tip-in Enrichment Compensation B (ECT) Activation
    scaling: ThrottleAngleChange(%)
    staticyaxis:
      data: [Active Above]
      elements: 1
      name: Tip-in Enrichment
  Closed Loop Fueling Target Limits: !!com.romraider.definition.table.Table2DDef
    category: Fueling - Closed Loop
    description: These are the minimum and maximum limits for the closed loop fueling target.
    level: 2
    name: Closed Loop Fueling Target Limits
    scaling: estimatedair/fuelratio2
    staticyaxis:
      data: [Rich Limit, Lean Limit]
      elements: 2
      name: CL Fueling Target Limits
  Primary Base Enrichment Additive 3 Initial Start 1B: !!com.romraider.definition.table.Table2DDef
    category: Fueling - Warm-Up Enrichment
    description: This is the initial afterstart enrichment offset for group 3. This value decays to zero based on the "decay step" value. Group 3 is one of three factors which determines the primary fuel afterstart enrichment. The primary fuel enrichment is a multiplier (determined primarily by the open loop fuel maps) applied to the base injector duration to determine the level of primary enrichment. The enrichment offsets determined by tables 2 and 3 are averaged and added along with table 1 to primary enrichment to determine the final primary enrichment. To determine an approximate AFR for a particular condition, first determine the primary enrichment as determined by the open loop fuel maps (and after other compensations/limits are applied) and calculate the base fueling multiplier as 14.7/x. Then add the additional afterstart enrichment as determined from group 1, and 2/3 (see individual help text) and the approximate AFR will be 14.7/x.
    level: 1
    name: Primary Base Enrichment Additive 3 Initial Start 1B
    scaling: InitialAfterstartOffset
    staticyaxis:
      data: ['-40', '-22', '-4', '14', '32', '50', '68', '86', '104', '122', '140',
        '158', '176', '194', '212', '230']
      elements: 16
      name: Coolant Temperature (F)
  Primary Base Enrichment Additive 3 Initial Start 2B_: !!com.romraider.definition.table.Table2DDef
    category: Fueling - Warm-Up Enrichment
    description: This is the initial afterstart enrichment offset for group 3. This value decays to zero based on the "decay step" value. Group 3 is one of three factors which determines the primary fuel afterstart enrichment. The primary fuel enrichment is a multiplier (determined primarily by the open loop fuel maps) applied to the base injector duration to determine the level of primary enrichment. The enrichment offsets determined by tables 2 and 3 are averaged and added along with table 1 to primary enrichment to determine the final primary enrichment. To determine an approximate AFR for a particular condition, first determine the primary enrichment as determined by the open loop fuel maps (and after other compensations/limits are applied) and calculate the base fueling multiplier as 14.7/x. Then add the additional afterstart enrichment as determined from group 1, and 2/3 (see individual help text) and the approximate AFR will be 14.7/x.
    level: 1
    name: Primary Base Enrichment Additive 3 Initial Start 2B_
