    description: This is the maximum amount of knock-based timing advance (knock correction advance) that can be added to base timing. Total timing = base timing + knock correction advance + other timing compensations. Knock correction advance = (knock correction advance max map value * (current advance multiplier / 16)) + feedback knock correction + fine learning knock correction.
