    yaxis: {elements: 16, name: Engine Speed, scaling: RPM}
  Feedback Correction Disable (ECT): !!com.romraider.definition.table.Table2DDef
    category: Ignition Timing - Knock Control
    description: When coolant temp is greater than equal to this value, Feedback correction is disabled if all other conditions (most undefined) are also met. Disabling of feedback correction is necessary for changes to fine learning correction or the IAM (i.e. rough correction).
    level: 2
    name: Feedback Correction Disable (ECT)
    scaling: DegreesF
    staticyaxis:
      data: [Above]
      elements: 1
      name: Potentially Disable Feedback Correction
  Manifold Pressure Sensor Multiplier B: !!com.romraider.definition.table.Table2DDef
    category: Manifold Pressure Sensor
    description: This multiplier is involved in calculating manifold absolute pressure from manifold pressure sensor voltage. This multiplier is applied to MPS voltage and the offset, as determined by the 'Manifold Pressure Sensor Offset' table, is added to the result. When making changes to this table, be sure to make the same changes to all of the multiple multiplier tables.
    level: 2
    name: Manifold Pressure Sensor Multiplier B
    scaling: psia/v
    staticyaxis:
      data: [Multiplier]
      elements: 1
      name: MPS Voltage to Manifold Absolute Pressure
  Primary Open Loop Fueling B: !!com.romraider.definition.table.Table3DDef
    category: Fueling - Primary Open Loop
    description: This fuel map is used in open loop when the ignition advance multiplier (IAM) is greater than or equal to the threshold specified by the 'Primary Open Loop Fuel Map Switch (IAM)' table. Because there is no feedback in open loop, the actual AFR may differ from the values presented in this table. In addition, the ECU applies a long-term correction (A/F Learning) to open loop fueling from patterns it recognizes in closed loop fueling. Other compensations and minimum enrichment factors exist as well. Because the underlying values of this table are enrichment offsets relative to stoichiometric, AFRs leaner than 14.7, as presented, are not valid.
    level: 4
    name: Primary Open Loop Fueling B
    scaling: EstimatedAir/FuelRatio
    xaxis: {elements: 14, name: Engine Load, scaling: g/rev}
    yaxis: {elements: 16, name: Engine Speed, scaling: RPM}
  Manifold Pressure Sensor Multiplier C: !!com.romraider.definition.table.Table2DDef
