  CL Delay Maximum Engine Speed: !!com.romraider.definition.table.Table2DDef
    category: Fueling - CL/OL Transition
    description: When engine speed is the same or greater than the second value, the CL to OL Delay value is set to zero which can result in switching from closed loop to open loop depending on the current enrichment value as determined by the 'Open Loop Fueling' map. When engine speed drops below the first value, other specific closed loop triggers are reviewed. If all these triggers are below their thresholds, then the CL to OL Delay is determined from the 'CL to OL Delay' table. In this case, assuming a non-zero delay value, the 'CL to OL Transition with Delay (Base Pulse Width)' and 'CL to OL Transition with Delay (Throttle)' are used to determine the open loop to close loop transition and vice versa.
    level: 3
    name: CL Delay Maximum Engine Speed
    scaling: EngineSpeed(RPM)
    staticyaxis:
      data: [(Below) - Check Other CL Tables, (Above) - Clear CL Delay]
      elements: 2
      name: (Condition) - Result
  Radiator Fan Modes (ECT): !!com.romraider.definition.table.Table2DDef
    category: Miscellaneous - Thresholds
    description: These are thresholds based on coolant temp which, along with the mode specified by the vehicle speed threshold table, are involved in determining radiator fan control. Radiator fan modes for coolant temp range from 0 to 2. Current mode thresholds are dependent on whether the coolant temperature is increasing or decreasing. Generally, as the coolant temp mode is higher and the vehicle speed mode is lower, the more likely the radiator fan(s) will come on. Whether the A/C is on or not also impacts the fan control.
    level: 2
    name: Radiator Fan Modes (ECT)
    scaling: CoolantTemperature(DegreesF)
    staticyaxis:
      data: [M0 max|M1 min(dec), M1 min(inc), M2 min(dec), M2 min(inc)]
