  CL to OL Transition with Delay (Base Pulse Width)(MT): !!com.romraider.definition.table.Table2DDef
    category: Fueling - CL/OL Transition
    description: When the CL to OL Delay value is non-zero, this table will be used to determine the transition from closed loop to open loop and back again. When the base pulse width, ((2707.09/Injector Flow Scaling) * Engine Load (g/rev))), rises above the threshold in this table, the process to exit closed loop begins. The current delay value is a counter threshold for which the throttle threshold must be continuously exceeded (otherwise counter is reset to zero and CL to OL transition does not take place). When the base pulse width drops below the threshold (and below a predetermined delta), fueling will transition from open loop to closed loop.
    level: 3
    name: CL to OL Transition with Delay (Base Pulse Width)(MT)
    scaling: BasePulseWidth(ms)2
    staticyaxis:
      data: [Begin CL to OL Transition over Delay Continuously Exceeding]
      elements: 1
      name: ''
