    description: When the EGT is the same or greater than the second value, the CL to OL Delay value is set to zero which can result in switching from closed loop to open loop depending on the current enrichment value as determined by the 'Open Loop Fueling' map. When the EGT drops below the first value, other specific closed loop triggers are reviewed. If all these triggers are below their thresholds, then the CL to OL Delay is determined from the 'CL to OL Delay' table. In this case, assuming a non-zero delay value, the 'CL to OL Transition with Delay (Base Pulse Width)' and 'CL to OL Transition with Delay (Throttle)' are used to determine the open loop to close loop transition and vice versa.
