    category: Boost Control - Target
    description: This offset is involved in the calculation of a multiplier designed to reduce target boost as atmospheric pressure decreases. The value from the 'Target Boost Compensation (Atm. Pressure) Multiplier' table is first applied to current atmospheric pressure and then the offset is added to the product. The resulting multiplier is limited to a range between 0 and 1 and then applied to target boost (absolute pressure).
    level: 2
    name: Target Boost Compensation (Atm. Pressure) Multiplier Offset
    scaling: AtmosphericPressureMultiplierOffset
    staticyaxis:
      data: [Offset]
      elements: 1
      name: Target Boost Compensation Multiplier Determination
