    category: Group N - Conditions
    description: Warning - Untested. This 8-bit array determines the enabling or disabling of certain features. Bit 3 SET/NOT SET = Anti-lag and launch control ENABLED/DISABLED. Bit 7 SET/NOT SET = Per gear wastegate and boost DISABLED/ENABLED. Bit 4 = unknown (related to CL/OL fueling). Bit 5 = unknown (related to ISCV duty). The factory default is 136d, which indicates that Anti-Lag/Launch Control are ENABLED and per gear wastegate and boost compensation are DISABLED. The disabling of anti-lag and launch control is managed through the Group N conditions check, which means, when those features are disabled through this mode byte, map switching will default to the 'Group N Conditions Not Met' tables.
