  Maximum Primary Fueling CL to OL Intermediate Steps: !!com.romraider.definition.table.Table2DDef
    category: Fueling - Primary Open Loop
    description: When transitioning between closed loop and open loop fueling, these maximum steps, along with the 'Min Primary Fueling CL to OL Intermediate Enrich' value, determine the number of steps and the intermediate enrichment at each step before the normal primary enrichment is used. When the transition from CL to OL occurs, a counter, starting at zero, is incremented each execution. At zero (if maximum step value is also not zero), the intermediate enrichment value is used. When the counter reaches the maximum value, the primary enrichment is used and the intermediate sequence ends. If the counter is greater than zero and less than the maximum step value, the counter and the maximum value are used to determine the ratio of intermediate to primary enrichment. For example, if the counter is 1 and the maximum value is 2, then the additional enrichment on top of the intermediate enrichment will be one-half of the difference between the primary enrichment and the intermediate value. If the counter is 2 and the maximum value is 3, then the ratio would be two-thirds. To disable the intermediate enrichment behavior, set the maximum steps to zero.
    level: 1
    name: Maximum Primary Fueling CL to OL Intermediate Steps
    scaling: steps/ratio
    staticyaxis:
      data: [Maximum]
      elements: 1
      name: Intermediate CL to OL Enrichment
