  CL to OL Delay: !!com.romraider.definition.table.Table2DDef
    category: Fueling - CL/OL Transition
    description: This is the period over which the 'CL to OL with Delay' throttle or base pulse width thresholds must be continuously exceeded before the closed loop to open loop fueling transition can take place. Only one of the four delay groups will be accessed at any given time depending on transmission type and other factors than can vary by ROM. And only one of the four values from each group determines the delay which depends on the time since the last engine start (first value in each grouping is the earliest range). If the current delay is non-zero, the 'CL to OL Transition with Delay (Throttle)' or 'CL to OL Transition with Delay (Base Pulse Width)' tables will be used to determine the transition from closed loop to open loop if either threshold is continuously exceeded over the current delay period. If the delay is zero, then these tables will not be used and the closed loop to open loop transition will be decided by the current enrichment as determined by the 'Primary Open Loop Fueling' and 'Minimum Active Primary Open Loop Enrichment' tables.
    level: 2
    name: CL to OL Delay
    scaling: counterthreshold
    staticyaxis:
      data: [A-1, A-2, A-3, A-4, B-1, B-2, B-3, B-4, C-1, C-2, C-3, C-4, D-1, D-2,
        D-3, D-4]
      elements: 16
      name: Delay Group-Value
