    level: 1
    name: Primary Base Enrichment Additive 1_
    scaling: PrimaryEnrichmentOffsetAdditive11
    staticyaxis:
      data: ['-40', '-22', '-4', '14', '32', '50', '68', '86', '104', '122', '140',
